import React, { useState } from "react";
import UsersList from "./UsersList";

function List2(props) {
  const Data = [
    {
      id: Math.random().toString(),
      name: {
        salutation: "Mr.",
        first: "Justin",
        last: "Patel",
      },
    },
    {
      id: Math.random().toString(),
      name: {
        salutation: "Mrs.",
        first: "Agatha",
        last: "Shah",
      },
    },
    {
      id: Math.random().toString(),
      name: {
        salutation: "Mr.",
        first: "Darshan",
        last: "Gajjar",
      },
    },
    {
      id: Math.random().toString(),
      name: {
        salutation: "Mrs.",
        first: "Vanshika",
        last: "Vekariya",
      },
    },
    {
      id: Math.random().toString(),
      name: {
        salutation: "Mr.",
        first: "Dev",
        last: "Patil",
      },
    },
    {
      id: Math.random().toString(),
      name: {
        salutation: "Mrs.",
        first: "Joaquin",
        last: "Phoenix",
      },
    },
    {
      id: Math.random().toString(),
      name: {
        salutation: "Mr.",
        first: "Robert",
        last: "Downey",
      },
    },
    {
      id: Math.random().toString(),
      name: {
        salutation: "Mrs.",
        first: "Joker",
        last: "Batman",
      },
    },
  ];
  const [outputUserList2, setOutputUserList2] = useState(Data);
  setOutputUserList2(
    Data.filter((item) => {
      const Name2 = `${item.name.salutation} ${item.name.first} ${item.name.last} `;
      return Name2.toLowerCase().includes(props.searchVal);
    })
  );
  return (
    <div>
      <UsersList outputUsersList={outputUserList2} />
    </div>
  );
}

export default List2;
